sys_variable_value.value:
(function execute(inputs, outputs) {
    var recordSysID = inputs.recordSysID;
    var resultCode = "Failed";
    var errorMessage = "";
    var catHelper = new global.catalogVariableHelper();


    var answer = catHelper.getPointOfContactCatVariables(recordSysID);

    

    if(answer.result.startsWith('Error Occured ')){
        resultCode = "Failed";
       errorMessage = answer.result;
    } else {
        resultCode = "Success";
        outputs.answer = answer;
    }

    outputs.resultcode = resultCode;
    outputs.errormessage = errorMessage;
})(inputs, outputs);

